        <section className='Estilos'>
            <h2>Estilos en react</h2>
            <h3 className='bg-react'>Estilo Hoja CSS externa</h3>
            <h3 className='bg-react' style={{borderRadius:".25rem" , margin:"1rem"}}>mEstilo Hoja CSS externa(atributo style)</h3>
        </section>
    )
}
